DROP DATABASE IF EXISTS dbsa;
-- A) Creación y Uso de la Base de Datos
CREATE DATABASE dbsa;
USE dbsa;


-- B) Creación de las tablas según el modelado
-- 1. PERIODOS
CREATE TABLE periodos
(
	idperiodo			INT				AUTO_INCREMENT	PRIMARY KEY,
	anio					CHAR(4)		NOT NULL,
	fechainicio		DATE 			NOT NULL,
	fechatermino	DATE 			NULL,
	estado				CHAR(1)		NOT NULL 				DEFAULT '1'
)ENGINE=INNODB;


-- 2. HORARIOS
CREATE TABLE horarios
(
	idhorario 		INT				AUTO_INCREMENT	PRIMARY KEY,
	idperiodo_fk 	INT 			NOT NULL,
	turno 				CHAR(1) 	NOT NULL, 			-- M(añana) - T(arde)
	horaentrada 	TIME 			NOT NULL,
	horasalida 		TIME 			NOT NULL,
	toleranciamin TINYINT		NOT NULL,
	desde					DATE			NOT NULL,
	hasta					DATE			NULL,
	estado 				CHAR(1) 	NOT NULL 				DEFAULT '1',
	
	CONSTRAINT fk_idperiodo_hor FOREIGN KEY (idperiodo_fk) REFERENCES periodos (idperiodo)
)ENGINE=INNODB;


-- 3. UBIGEOS
CREATE TABLE ubigeos
(
	idubigeo 			INT 				AUTO_INCREMENT 	PRIMARY KEY,
	codubigeo 		CHAR(6) 		NOT NULL,
	departamento	VARCHAR(30) NOT NULL,
	provincia			VARCHAR(30) NOT NULL,
	distrito			VARCHAR(30) NOT NULL
)ENGINE=INNODB;


-- 4. PERSONAS
CREATE TABLE personas
(
	idpersona			INT						AUTO_INCREMENT	PRIMARY KEY,
	idubigeo_fk		INT 					NOT NULL,
	tipodocumento	CHAR(1) 			NOT NULL, 			-- D(NI) - C(arnet Extranjería) - P(asaporte) - T(emporal)
	nrodocumento	VARCHAR(9) 		NOT NULL,
	fechanac			DATE 					NULL,
	apepaterno		VARCHAR(50) 	NOT NULL,
	apematerno		VARCHAR(50) 	NULL,
	nombres				VARCHAR(50)		NOT NULL,
	direccion			VARCHAR(100)	NULL,
	genero				CHAR(1) 			NOT NULL				DEFAULT 'F',
	telefono			CHAR(9) 			NULL,
	email					VARCHAR(120) 	NULL,
	observacion		TEXT 					NULL,
	fotografia		VARCHAR(100)	NULL,
	fechacreacion	DATETIME			NOT NULL				DEFAULT NOW(),
	fechabaja			DATETIME			NULL,
	estado				CHAR(1)				NOT NULL				DEFAULT '1',
	
	CONSTRAINT fk_idubigeo_pers FOREIGN KEY (idubigeo_fk) REFERENCES ubigeos (idubigeo),
	CONSTRAINT uk_nrodocumento_pers UNIQUE (tipodocumento, nrodocumento),
	CONSTRAINT uk_email_pers UNIQUE (email)
)ENGINE=INNODB;


-- 5. CARGOS
CREATE TABLE cargos
(
	idcargo				INT 				AUTO_INCREMENT 	PRIMARY KEY,
	nombrecargo		VARCHAR(70) NOT NULL,
	fechacreacion	DATETIME		NOT NULL 				DEFAULT NOW(),
	fechabaja			DATETIME		NULL,
	estado				CHAR(1)			NOT NULL 				DEFAULT '1'
)ENGINE=INNODB;


-- 6. COLABORADORES
CREATE TABLE colaboradores
(
	idcolaborador INT 					AUTO_INCREMENT 	PRIMARY KEY,
	idcargo_fk		INT 					NOT NULL,
	idpersona_fk	INT 					NOT NULL,
	nombreusuario VARCHAR(70)		NOT NULL,
	claveacceso		VARCHAR(100)	NOT NULL,
	nivelacceso		CHAR(3)				NOT NULL,				-- DIR(ECTOR) - SUB(DIRECTOR) - DOC(ENTE) - AUX(ILIAR) - APO(DERADO)
	fechacreacion	DATETIME			NOT NULL 				DEFAULT NOW(),
	fechabaja			DATETIME			NULL,
	estado				CHAR(1)				NOT NULL 				DEFAULT '1',
	
	CONSTRAINT fk_idcargo_col FOREIGN KEY (idcargo_fk) REFERENCES cargos (idcargo),
	CONSTRAINT fk_idpersona_col FOREIGN KEY (idpersona_fk) REFERENCES personas (idpersona),
	CONSTRAINT uk_nombreusuario_col UNIQUE (nombreusuario)
)ENGINE=INNODB;


-- 7. GRUPOS
CREATE TABLE grupos
(
	idgrupo 			INT 			AUTO_INCREMENT 	PRIMARY KEY,
	idhorario_fk 	INT 			NOT NULL,
	idtutor_fk 		INT 			NULL,
	grado 				CHAR(1) 	NOT NULL,
	seccion 			CHAR(1) 	NOT NULL,
	fechacreacion	DATETIME	NOT NULL 				DEFAULT NOW(),
	fechabaja			DATETIME	NULL,
	estado				CHAR(1)		NOT NULL 				DEFAULT '1',
	
	CONSTRAINT fk_idhorario_gru FOREIGN KEY (idhorario_fk) REFERENCES horarios (idhorario),
	CONSTRAINT fk_idtutor_gru FOREIGN KEY (idtutor_fk) REFERENCES colaboradores (idcolaborador)
)ENGINE=INNODB;


-- 8. MATRICULAS
CREATE TABLE matriculas
(
	idmatricula 				INT 				AUTO_INCREMENT 	PRIMARY KEY,
	idgrupo_fk 					INT 				NOT NULL,
	idapoderado_fk			INT 				NULL,
	idalumna_fk					INT 				NOT NULL,
	relacionestudiante 	VARCHAR(30)	NULL,
	fechacreacion				DATETIME		NOT NULL 				DEFAULT NOW(),
	fechabaja						DATETIME		NULL,
	estado							CHAR(1)			NOT NULL 				DEFAULT 'A',		-- A(CTIVO), L(ICENCIA), R(RETIRADO)
	
	CONSTRAINT fk_idgrupo_mat FOREIGN KEY (idgrupo_fk) REFERENCES grupos (idgrupo),
	CONSTRAINT fk_idapoderado_mat FOREIGN KEY (idapoderado_fk) REFERENCES personas (idpersona),
	CONSTRAINT fk_idalumna_mat FOREIGN KEY (idalumna_fk) REFERENCES personas (idpersona)
)ENGINE=INNODB;


-- 9. ASISTENCIAS
CREATE TABLE asistencias
(
	idasistencia 		INT 		AUTO_INCREMENT 	PRIMARY KEY,
	idmatricula_fk 	INT 		NOT NULL,
	horaentradaalu 	TIME 		NOT NULL 				DEFAULT (CURTIME()),
	horasalidaalu 	TIME 		NULL,
	fecharegistro		DATE 		NOT NULL 				DEFAULT (CURDATE()),
	estado					CHAR(1)	NOT NULL 				DEFAULT 'P',						-- P(untual), T(ardanza)
	
	CONSTRAINT fk_idmatricula_asi FOREIGN KEY (idmatricula_fk) REFERENCES matriculas (idmatricula)
)ENGINE=INNODB;


-- 10. MOTIVOS
CREATE TABLE motivos
(
	idmotivo 						INT 					AUTO_INCREMENT	PRIMARY KEY,
	descripcionmotivo 	VARCHAR(100)	NOT NULL,
	estado							CHAR(1)				NOT NULL 				DEFAULT '1'
)ENGINE=INNODB;


-- 11. PERMISOS
CREATE TABLE permisos
(
	idpermiso 								INT 					AUTO_INCREMENT 	PRIMARY KEY,
	idasistencia_fk 					INT 					NOT NULL,
	idmotivo_fk 							INT 					NOT NULL,
	idcolaboradorautoriza_fk 	INT 					NOT NULL,
	comentario 								TEXT 					NOT NULL,
	evidencia 								VARCHAR(100) 	NULL,
	fechahorapermiso 					DATETIME 			NOT NULL 				DEFAULT NOW(),
	estado										CHAR(1)				NOT NULL 				DEFAULT '1',

	CONSTRAINT fk_idasistencia_per FOREIGN KEY (idasistencia_fk) REFERENCES asistencias (idasistencia),
	CONSTRAINT fk_idmotivo_per FOREIGN KEY (idmotivo_fk) REFERENCES motivos (idmotivo),
	CONSTRAINT fk_idcolaut_per FOREIGN KEY (idcolaboradorautoriza_fk) REFERENCES colaboradores (idcolaborador)
)ENGINE=INNODB;


-- 12. RECUPERACIÓN DE CONTRASEÑAS
CREATE TABLE desbloqueos
(
	iddesbloqueo			INT 					AUTO_INCREMENT 	PRIMARY KEY,
	idcolaborador_fk 	INT 					NOT NULL,
	fechageneracion		DATETIME			NOT NULL 				DEFAULT NOW(),
	email							VARCHAR(120)	NOT NULL,				-- email que se utilizó en este momento
	clavegenerada			CHAR(4)				NOT NULL,
	estado						CHAR(1)				NOT NULL 				DEFAULT '1',
	
	CONSTRAINT fk_idcolaboradorfk_rcl FOREIGN KEY (idcolaborador_fk) REFERENCES colaboradores (idcolaborador)
)ENGINE = INNODB;


